import MUIDataTable from 'mui-datatables'

const columns = [
	{
		name: 'userId',
		label: 'User ID',
		options: {
			filter: false,
			sort: false
		}
	}
]

const options = {
	download: false,
	print: false
}

const UserRFM = ({ data }) => {
	console.log(data)
	return <MUIDataTable title={'User RFM'} data={data} columns={columns} options={options} />
}

export default UserRFM
